window.bookSummaryJSON = "<p>A new time-travel thriller from <i>Washington Post</i>, <i>Wall Street Journal</i>, Amazon and Audible best-selling author R. R. Haywood. Creator of the smash-hit time-travel series Extracted and the UK’s number one horror series The Undead.&nbsp;</p> <p>A man falls from the sky. He has no memory. He has no sense of self. What lies ahead are a series of tests, each more brutal than the last, and if he gets through them all, he might just reach a town called Discovery.</p>"; 
